package ControlStatementsandArrays;



public class defaultValdatatype {
	
	   static boolean val1;
	   static double val2;
	   static float val3;
	   static int val4;
	   static long val5;
	   static String val6;
	   static char val7;
	   static short val8;
	   static byte val9;
	
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		  System.out.println("Default values.....");
	      System.out.println("boolean = " + val1);
	      System.out.println("double = " + val2);
	      System.out.println("float = " + val3);
	      System.out.println("int= " + val4);
	      System.out.println("long = " + val5);
	      System.out.println("String = " + val6);	
	      System.out.println("char = "+ val7);
	      System.out.println("short = "+ val8);
		  System.out.println("byte = "+val9);
			
	}

}
